	(4, 3, 3, 'Выгрузка справочника номенклатуры принципалами', '', '2014-08-06', NULL, 5, 1, 3, NULL, 1, 6, '2014-08-05 09:40:58', '2015-12-22 12:27:57', '2014-08-06', 0, NULL, NULL, 4, 1, 2, 0, '2015-12-11 09:35:45'),
	(5, 1, 3, 'Протокол отклонения РГК (МРГ)', 'Пожалуйста, откорректируй шаблоны итоговых протоколов или покажи, как, и я откорректирую\r\n\r\n_____\r\n\r\nС уважением,\r\nКармаликова Наталья Николаевна\r\nНачальник отдела аналитики\r\nООО «Газэнергоинформ»\r\n8(812) 449-34-77 доб. 114\r\n8-911-231-84-43\r\ne-mail: n.karmalikova@gazenergoinform.ru\r\n\r\n \r\n\r\nFrom: Дарья Разборова [mailto:d.razborova@gazenergoinform.ru] \r\nSent: Monday, August 04, 2014 4:25 PM\r\nTo: \'Наталья Кармаликова\'\r\nSubject: Протокол отклонения РГК (МРГ)\r\n\r\n \r\n\r\nВ протоколе отклонения (РГК) решение по процедуре должно указываться только в том случае, если Организатором закупки были отклонены заявки всех участников закупки. Соответственно в п. 4.2. будет  указываться: «Признать процедуру запроса предложений по лоту несостоявшейся».\r\n\r\n \r\n\r\nВ случае, если по закупочной процедуре наряду с протоколом отклонения составляется итоговый протокол, то  указывать в протоколе отклонения решение по процедуре «Признать процедуру запроса предложений по лоту состоявшейся» является недопустимым (противоречит п. 7.7.2.Положения о закупках товаров, работ, услуг МРГ).\r\n\r\n \r\n\r\nС уважением, Разборова Дарья\r\n\r\nЮрист ООО "Газэнергоинформ"\r\n\r\nТел. 8(812) 449-34-77 (доб. 144)\r\n\r\nМоб. 89119979890\r\n', NULL, NULL, 5, 1, 3, NULL, 1, 5, '2014-08-05 09:45:02', '2015-12-22 12:30:02', '2014-08-05', 0, NULL, NULL, 5, 1, 2, 0, '2014-08-18 08:54:33'),
	(6, 1, 3, 'Корректировка отчета РГ3', '', NULL, NULL, 5, 1, 2, NULL, 1, 4, '2014-08-05 09:46:12', '2015-12-22 12:29:47', '2014-08-05', 100, 4, NULL, 6, 1, 2, 0, '2014-08-12 22:58:37'),
	(7, 3, 3, 'Удаление старых агентских поручений', 'Необходимо удалить черновики агентских поручений 2013 года\r\nВ 2014 году необходимо очистить АП с номенклатурой 2013 года', '2014-08-05', NULL, 5, 1, 4, NULL, 1, 5, '2014-08-05 11:47:31', '2015-12-22 12:30:02', '2014-08-05', 100, 3, NULL, 7, 1, 4, 0, '2014-08-12 22:58:47'),
