	(10, 1, 3, 'Доработка Шаблоново Итоговых Протоколов РГК (МРГ)', 'Вячеслав Александрович, добрый  день!\r\n\r\n \r\n\r\nПрошу внести корректировку в шаблоны итоговых протоколов по РГК (Шаблоны № 1 и 2 )\r\n\r\nНеобходимо:\r\n\r\n1.      В случае, если по закупочной процедуре наряду с протоколом отклонения (Шаблон № 2 ) составляется итоговый протокол,   не должен вообще  отображаться раздел  4.2. «Решение по лотам запроса предложений».\r\n\r\nРаздел 4.2 «Решение по лотам запроса предложений» должен отображаться , если составляется  только протокол отклонена, что означает, что закупка не состоялась. В этом случай, все должно остаться, как  сейчас.\r\n\r\n2.      Все сведения по отклоненным участникам должны отражаться и в итоговом протоколе (Шаблон № 1 )  согласно письму юристов (письмо в приложении)  \r\n\r\n \r\n\r\n \r\n\r\nСпасибо\r\n\r\n \r\n\r\n_____\r\n\r\nС уважением,\r\nКармаликова Наталья Николаевна\r\nНачальник отдела аналитики\r\nООО «Газэнергоинформ»\r\n8(812) 449-34-77 доб. 114\r\n8-911-231-84-43\r\ne-mail: n.karmalikova@gazenergoinform.ru', NULL, NULL, 5, 1, 2, NULL, 1, 3, '2014-08-05 20:18:34', '2015-12-22 12:30:02', '2014-08-05', 0, NULL, NULL, 10, 1, 2, 0, '2014-08-18 08:54:33'),
