	(37, 1, 3, 'Изменения шаблона итогового протокола МРГ', 'Посмотри, пож-та, шаблон, согласованный юр.отделом, для итогов МРГ.\r\n\r\n \r\n\r\nПо нему в п.4 должны быть указаны все участники, подавшие заявки.\r\n\r\nВ п.5 несоответствующие участники и решение с обоснованиями для отклонений.\r\n\r\n \r\n\r\nСейчас реализован следующий алгоритм для данных шаблонов в АИС УЦП.\r\n\r\nВ п.4 попадают только соответствующие участники.\r\n\r\nВ п.5 несоответствующие, без указания условий поставки (цена, срок, оплата), только с указанием причины отклонения.\r\n\r\n \r\n\r\nС уважением,\r\n\r\nДенисова Дина Васильевна\r\n\r\n \r\n\r\n \r\n\r\nFrom: Наталья Тюшова [mailto:n.tushova@gazenergoinform.ru] \r\nSent: Tuesday, August 19, 2014 1:08 PM\r\nTo: Дина Васильевна Денисова\r\nCc: \'Дмитрий Пониматкин\'\r\nSubject: RE: шаблоны итоги МРГ\r\n\r\n \r\n\r\nДина, данные изменения не могут быть согласованы, так как согласно требованиям Положения о закупках в итоговом протоколе должны содержаться сведения обо всех участниках, подавших заявки на участие в закупке (п. 7.7.3 Положения РГК). Кроме того, в итоговом протоколе необходимо указать сведения об участниках, чьи заявки были отклонены с указанием положений документации, которым эти заявки не соответствуют.\r\n\r\nПредлагаемые изменения в приложенном файле.\r\n\r\n \r\n\r\nС уважением,\r\n\r\nЮрист ООО "Газэнергоинформ"\r\n\r\nТюшова Наталья Евгеньевна\r\n\r\nn.tushova@gazenergoinform.ru\r\n\r\n \r\n\r\nFrom: Дмитрий Пониматкин [mailto:d.ponimatkin@gazenergoinform.ru] \r\nSent: Monday, August 18, 2014 4:46 PM\r\nTo: n.tushova@gazenergoinform.ru\r\nSubject: FW: шаблоны итоги МРГ\r\n\r\n \r\n\r\nГоворят, что это согласовано мною.   …?\r\n\r\n \r\n\r\n \r\n\r\nС уважением,\r\n\r\nПониматкин Дмитрий Викторович\r\n\r\nРуководитель юридического отдела ООО «Газэнергоинформ»\r\n\r\n8(812) 449-34-77 доб. 121\r\n\r\n8-911-761-65-75\r\n\r\n \r\n\r\nFrom: Дина Денисова [mailto:d.denisova@gazenergoinform.ru] \r\nSent: Friday, August 15, 2014 6: