	(41, 3, 3, 'Ошибка открытия файла', 'Все работает корректно\r\n\r\n\r\n\r\n\r\nКогда принципал скачивает из УЦП раровские файлы (как правило по Работам), у файла в конце названия появляется «-«, поэтому принципал не может открыть файл, а толькопосле переименовании и удалении черточки.\r\n\r\nМного обращений\r\n\r\nМожно ли убрать?', '2014-09-01', NULL, 5, NULL, 2, NULL, 1, 1, '2014-09-01 12:17:44', '2015-12-22 12:29:51', '2014-09-01', 0, 0.5, NULL, 41, 1, 2, 0, '2014-09-01 12:17:44'),
	(42, 3, 3, 'Ошибка протокола УЦП протокол № 32935', '\r\nНачально максимальная цена НДС не облагается, (так как это ЭВМ лицензия), участники подались кто-то с НДС, кто-то без НДС или НДС не облагается. В расчете программа не приводит значения к одному знаменателю ( т.е. и не убирает НДС и не накидывает), и участников не получается сравнить правильно.\r\n\r\n \r\n\r\nПришлось накинуть НДС на начально максимальную, плюс каждому участнику без НДС, начислить НДС и сравнить. (накинула НДС, так как у лицензии облагается упаковка в которой они хранят диск)\r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\n \r\n\r\nС уважением,\r\n\r\nГрищенко Светлана\r\n\r\nВедущий специалист отдела документарного обеспечения закупок\r\n\r\nООО «Газэнергоинформ»\r\n\r\ne-mail: s.grischenko@gazenergoinform.ru\r\n\r\nтел. 8(812) 449-34-77 доб. 122', '2014-09-01', NULL, 5, NULL, 2, NULL, 1, 2, '2014-09-01 12:20:26', '2015-12-22 12:29:51', '2014-09-01', 0, 1, NULL, 42, 1, 2, 0, '2014-09-01 12:47:32'),
	(43, 3, 3, 'Контроль отправки документов принципалу', 'У нас все коллеги пользуются этим отчетом для проверки\r\n\r\nДелали его до корректировки АП\r\n\r\nПожалуйста, посмотри настройки, нормально ли все в настройках, не будет ли возникать дублей из-за корректировок АП?\r\n\r\n \r\n\r\nЭто отчет по прикрепленный в УЦП документам. А нам надо в дополнение к нему еще по ОТПРАВЛЕННЫМ принципалу (доступных принципалу).\r\n\r\nМожешь ли сделать все в одном отчете?\r\n\r\nАнжелика Борисовна просила, чтоб как можно скорее, а то протоколисты допускают ошибки именно по отправке (приложено, но не отправлено), а сейчас щштрафы за несвоевременное прикрепление документов\r\n\r\nИ коль уж буду аннулировать заявки, то к АНТ был один из самых острых вопросов починить все с прикреплением документов.\r\n\r\nЯ в следующем письме перенаправлю все ошибки, которые есть с прикреплением документов\r\n\r\nСпасибо\r\n\r\n \r\n\r\n_____\r\n\r\nС уважением,\r\nКармаликова Наталья Николаевна\r\nНачальник отдела аналитики\r\nООО «Газэнергоинформ»\r\n8(812) 449-34-77 доб. 114\r\n8-911-231-84-43\r\ne-mail: n.karmalikova@gazenergoinform.ru\r\n\r\n ', '2014-09-01', NULL, 5, NULL, 2, NULL, 1, 1, '2014-09-01 12:52:49', '2015-12-22 12:29:52', '2014-09-01', 0, 0.5, NULL, 43, 1, 2, 0, '2014-09-01 12:52:49'),
	(44, 3, 3, 'Передача в ГЭИ отчетов по ГНГ', '', '2014-09-01', NULL, 5, NULL, 2, NULL, 1, 1, '2014-09-01 13:01:17', '2015-12-22 12:29:52', '2014-09-01', 0, 0.5, NULL, 44, 1, 2, 0, '2014-09-01 13:01:17'),
	(45, 2, 3, 'Шаблон письма о изменениях в опубликованной процедуре', '', NULL, NULL, 5, 4, 2, NULL, 1, 4, '2014-09-01 13:13:42', '2015-12-22 12:29:52', '2014-09-01', 0, NULL, NULL, 45, 1, 2, 0, '2014-10-31 13:48:49'),
	(46, 3, 3, 'Установить регламентные задания по обновлению справочника номенклатруры', '1. Обновление уровней номенклатуры', NULL, NULL, 5, 1, 2, NULL, 1, 2, '2014-09-08 09:09:17', '2015-12-22 12:29:52', '2014-09-08', 0, NULL, NULL, 46, 1, 2, 0, '2014-10-31 13:45:35'),
	(47, 3, 3, 'Обновить конфигурацию', 'В конфигурации общий модуль и обработка\r\nНеобходимо \r\n1. добавить их в основную конфигурацию\r\n2. права всем\r\n3. вывести на рабочем столе принципала на закладке номенклатура', '2014-09-11', NULL, 5, 1, 4, NULL, 1, 9, '2014-09-11 12:13:10', '2015-12-22 12:27:48', '2014-09-11', 100, 2, NULL, 47, 1, 2, 0, '2015-12-11 09:35:27'),
	(48, 2, 3, 'Несколько причин отклонения в итоговом протоколе по товарам', 'Необходимо реализовать механизм, при котором специалист Агента при формировании итогового протокола сможет выбирать по одной заявке участника одновременно несколько причин отклонения.', NULL, NULL, 5, 1, 3, NULL, 5, 3, '2014-09-11 16:11:44', '2015-12-22 12:29:53', '2014-09-11', 0, NULL, NULL, 48, 1, 2, 0, '2014-10-03 12:29:04'),
	(49, 1, 3, 'Починить шаблон XLS', 'отчет с кодом 9 выгруежат неверные значения по колонке тип предмета закупки', NULL, NULL, 5, 1, 2, NULL, 1, 3, '2014-09-12 16:47:50', '2015-12-22 12:29:53', '2014-09-12', 0, NULL, NULL, 49, 1, 2, 0, '2014-09-15 10:03:05'),
	(50, 3, 3, 'Загрузить присланных контрагентов', 'Обновить контрагентов по списку\r\nВ списке только участники и поставщики\r\n\r\nЗагрузить, заменить ссылки, удалить старые элементы.', NULL, NULL, 5, NULL, 2, NULL, 1, 3, '2014-09-18 09:58:02', '2015-12-22 12:29:53', '2014-09-18', 0, NULL, NULL, 50, 1, 2, 0, '2014-09-18 10:01:41'),
	(51, 1, 3, 'Оптимизация процесса формирования формы 35', 'При создании формы 35, обществом сопровождающим конфигурацию АИС УЦП были допущены следующие ошибки:\r\n1. В документе была задействована табличная часть, что привело к невозможности использовать многопользовательский режим. Исправлено самостоятельно АНТ\r\n2. После создания многопользовательского документа появилась возможность (необходимость) установки фильтров по номенклатуре. Допущены ошибки:\r\n2.1. Была использована конструкция *В Иерархии()*. Это при водило к увеличенной нагрузке на базу данных TempDB за счет необъективного количества считываемых элементов, а также периодичности опроса сервера БД(среднее количество пользователей 300, период автообновления 60 секунд, автообновление после записи строки); Метод исправления: создан регистр, который заполнен по принципу принадлежности элемента к каждой вышестоящей родительской группе. Скрипт (\r\n<pre>\r\n@ ИЗ\r\n	РегистрСведений.ДанныеФактаЗакупки КАК РегистрСведенийДанныеФактаЗакупки\r\n		ВНУТРЕННЕЕ СОЕДИНЕНИЕ (ВЫБРАТЬ РАЗЛИЧНЫЕ\r\n			ИерархияНоменклатуры.Ссылка КАК Ссылка\r\n		ИЗ\r\n			РегистрСведений.ИерархияНоменклатуры КАК ИерархияНоменклатуры\r\n		ГДЕ\r\n			(&Номенклатура = ЗНАЧЕНИЕ(Справочник.Номенклатура.ПустаяСсылка)\r\n					ИЛИ ИерархияНоменклатуры.Объект = &Номенклатура)) КАК ИерархияНоменклатуры\r\n		ПО РегистрСведенийДанныеФактаЗакупки.НоменклатураПлан = ИерархияНоменклатуры.Ссылка)@\r\n</pre>\r\n\r\n*Наполнение регистра происходит каждую ночь по мере изменения справочника на размер его изменения.*\r\n\r\n\r\n2.2. Был отключен признак динамического формирования списка. При выведение в интерфейс дополнительно на сервере формировалась временная таблица наполненная справочником номенклатура (всеми позициями которые выводились в динамическом списке). Нагрузка нята признаком динамического формирования. Конструктивная особенность платформы в том что при установленном признаке временная таблица не создается и нагрузка снижается. \r\n2.3. Отбор динамического списка по документу передавался не в Динамический список, а применялся к элементу формы. Применен отбор к динамическому списку.\r\nВсе описанные действия позволили разгрузить сервер и увеличить производительность и масштабируемость.', NULL, NULL, 5, NULL, 2, NULL, 1, 8, '2014-09-24 09:53:41', '2015-12-22 12:29:53', '2014-09-24', 0, NULL, NULL, 51, 1, 2, 0, '2014-09-24 10:41:04'),
	(52, 3, 3, 'Ответы на почту', '', NULL, NULL, 5, NULL, 2, NULL, 1, 1, '2014-09-30 10:20:38', '2016-03-16 13:50:30', '2014-09-30', 0, NULL, NULL, 52, 1, 2, 0, '2016-03-16 13:50:30'),
	(53, 1, 3, 'Наименование файлов, генерируемых в АИС УЦП', 'Наименование файлов, генерируемых в АИС УЦП с ошибкой\r\n1. "Извещение о изменении проведениИя запроса предложений № 35 740" - две "и" в слове "проведения"\r\n', NULL, NULL, 5, 1, 2, NULL, 5, 2, '2014-10-11 13:31:41', '2015-12-22 12:29:53', '2014-10-11', 0, NULL, NULL, 53, 1, 2, 0, '2014-10-29 22:47:13'),
	(54, 2, 3, 'Формирование новой редакции документов при внесении корректировок в АП', 'Корректировка АП должна быть доступна с момента подписания АП с двух сторон и до 10.00 дня вскрытия. при этом:\r\n1. если корректировка вносится до момента публикации ЗП на ЭТП (до изменения статуса на "Опубликовано на ЭТП") при редактировании новой закупочной документации в наименовании файлов не должно появляться "новая редакция"\r\n2. если корректировка вносится после публикации ЗП на ЭТП, то в наименовании файлов должно отражаться то, что это новая редакция документа ', NULL, NULL, 5, 1, 2, NULL, 5, 1, '2014-10-11 13:38:18', '2016-03-16 13:50:56', '2014-10-11', 0, NULL, NULL, 54, 1, 2, 0, '2016-03-16 13:50:56'),
	(55, 2, 3, 'Изменение шаблона выгрузки номенклатурного справочника принципалами из web-интерфейса', 'Необходимо добавить в шаблон выгрузки номенклатурного справочника принципалами столбец "Производитель" . Данные сведения необходимы принципалам для того, чтоб не искать эту информацию в интернете, а им в отчетах надо указывать возможных производителей', NULL, NULL, 5, 1, 3, NULL, 5, 2, '2014-10-11 13:40:24', '2015-12-22 12:24:12', '2014-10-11', 0, NULL, NULL, 55, 1, 2, 0, '2015-01-26 19:04:54'),
	(56, 1, 3, 'В отчетах РГ  некорректно выгружается предмет закупки ', 'Необходимо исправить  в отчетах РГ (3, 5, 9) выгрузку данных в столбец "Предмет закупки". Сейчас в данный столбец выгружается не только 0-й уровень ном.справочника, но и 2- й уровень (группы с неактуальными позициями)', NULL, NULL, 5, 1, 3, NULL, 5, 2, '2014-10-11 13:43:55', '2015-12-22 12:28:43', '2014-10-11', 0, NULL, NULL, 56, 1, 2, 0, '2015-02-09 15:06:10'),
	(57, 2, 3, 'Загрузка нового справочника ОКДП, ОКВЭД, ОКАТО в АИС УЦП', 'Необходимо загрузить новые справочники ОКДП, ОКВЭД, ОКАТО в АИС УЦП', NULL, NULL, 5, 1, 4, NULL, 5, 3, '2014-10-11 13:47:34', '2015-12-22 12:29:07', '2014-10-11', 0, NULL, NULL, 57, 1, 2, 0, '2014-12-09 18:05:28'),
	(58, 1, 3, 'Исправление настройки выгрузки номенклатурного справочника для ГНГ (не отражаются ед.измерения по части позиций)', 'Необходимо исправить  настройку выгрузки номенклатурного справочника для ГНГ (не отражаются ед.измерения по части позиций)', NULL, NULL, 5, 1, 3, NULL, 5, 2, '2014-10-11 13:49:13', '2015-12-22 12:29:54', '2014-10-11', 0, NULL, NULL, 58, 1, 2, 0, '2014-10-29 22:39:23'),
	(59, 2, 3, 'Журнал просмотра предыдущих редакций закупочной документации', 'Необходимо, чтобы у Агента была возможно просматривать прежние редакции закупочной документации, которые исчезают из видимости при создании новой редакции.\r\nДоступ к такому хранилищу должен быть как из электронного документа "Закупочная процедура" (вкладки "Документы", так и через вкладку "Показать приложенные документы"', NULL, NULL, 5, 1, 2, NULL, 5, 2, '2014-10-11 14:01:07', '2015-12-22 12:29:07', '2014-10-11', 0, NULL, NULL, 59, 1, 2, 0, '2014-11-01 21:40:13'),
	(60, 1, 3, 'Необходимо увеличить количество знаков по условиям оплаты в протоколах', 'Необходимо увеличить количество знаков до 3000 в поле по условиям оплаты при заведении данных по условиям оплаты в документ "Коммерческое предложение". а также обеспечить отражение такого количества знаков в протоколах вскрытия и итоговых протоколов\r\nПример условия по оплате для тестирования:\r\n"Без аванса. Затраты по статьям «Временные здания и сооружения» и «Непредвиденные работы и затраты» включены в общую стоимость работ по договору и оплачиваются только при предъявлении акта на временные здания и сооружения и непредвиденные работы и затраты. Расчет с Подрядчиком за выполненные Работы Заказчик  осуществляет следующим образом:Ежемесячно Стороны в установленном Договором порядке составляют и подписывают акт приемки выполненных работ по унифицированной  форме КС-2 в количестве четырех экземпляров – по два для каждой из сторон. На основании акта КС-2, Подрядчик составляет, а Заказчик  подписывает справку о стоимости выполненных ра-бот и затрат по унифицированной форме КС-3. В течение 5 дней после подписания справки о стоимости выполненных работ и затрат по форме КС-3 Подрядчик предоставляет Заказчику счет-фактуру. Расчеты с Подрядчиком за выполненные Работы Заказчик осуществляет в срок не более 30 календарных дней с даты получения счета-фактуры, но не ранее срока, определенного графиком производства и финансирования строительно – монтажных   работ Оплата выполненных Работ до сдачи Объекта в эксплуатацию осуществляется Заказчиком на сумму, не превышающую 80% от договорной цены Договора. Оставшуюся сумму Заказчик  оплачивает Подрядчику в срок не более 30 календарных дней с даты подписания Актов приемки законченного строительством  Объекта газораспределительной системы  по форме СНиП 42-01-2002 и КС-14.Если в процессе исполнения Договора выяснится несоответствие необходимых объёмов Работ проектным, которое невозможно было предусмотреть при заключении договора, Стороны выясняют причины и принимают письменное решение об изменении стоимости и/или перечня и/или сроков сдачи Работ. Никакие устные соглашения по этому вопросу силы не имеют. Оплату превышения расходов, в основе которых не лежат письменные соглашения Сторон, берёт на себя Подрядчик.Обязанность Заказчика по оплате выполненных Подрядчиком работ в случае частичного отказа от исполнения Договора, а также в случае расторжения Договора возникает у Заказчика только после передачи Подрядчиком результата незавершенных работ."', NULL, NULL, 5, 1, 4, NULL, 5, 1, '2014-10-11 14:04:35', '2016-03-16 13:50:09', '2014-10-11', 0, NULL, NULL, 60, 1, 2, 0, '2016-03-16 13:50:09'),
	(61, 2, 3, 'Краткая инструкция для ООЗ по проверке корректировки АП, если количество знаков в поле Тех.хар-к более 1000 знаков ', 'В связи с тем, что в поле "Технические характеристики" очень часто встречается текст с количеством знаков более 1000, необходима краткая инструкция для сотрудников в ООЗ о том, каким образом вести проверку внесенных корректировок в таком случае', NULL, NULL, 1, 1, 2, NULL, 5, 0, '2014-10-11 14:07:05', '2014-10-11 14:07:05', '2014-10-11', 0, NULL, NULL, 61, 1, 2, 0, NULL),
	(62, 2, 3, 'Оптимизация алгоритма формирования Извещения о внесении изменений в закупку', 'Необходимо оптимизировать алгоритм формирования Извещения о внесении изменений в закупку в части:\r\n1.  при внесении изменений исключительно в технические характеристики, изменяется только ТЗ по товарам\r\n2. при внесении изменений в сроки поставки, место поставки изменяется ТЗ  (КП не меняется)\r\n3. при внесении изменений в  условия оплаты изменяется ТЗ и Документация о ЗП(КП не меняется)\r\n4. при изменении АП по работам и услугам файл "ТЗ" автоматически не генерируется в УЦП - это должно учитываться при формировании Извещения о внесении изменений в ЗП', NULL, NULL, 5, 1, 2, NULL, 5, 1, '2014-10-11 14:13:26', '2016-03-16 13:48:30', '2014-10-11', 0, NULL, NULL, 62, 1, 2, 0, '2016-03-16 13:48:30'),
	(63, 2, 3, 'Увеличение количества знаков в наименовании критерия оценки', 'Необходимо увеличить количество знаков в критерии оценки, т.к. в настоящее время критерии оценки сильно сокращены, что может вызвать очень спорные ситуации с участниками закупок, т.к. сокращенные наименования (очень отличные от наименования критериев оценки в других частях Документации о ЗП) выгружаются в Документацию о ЗП и в итоговые протоколы. \r\n\r\nПример: \r\nНаличие дог. страх-ия гражд. ответ-сти рисков(страх.сумма не менее 5млн. руб.),которые могут возн-ть вследствие ненадлеж-го вып-я работ(оказ-я услуг) \r\nРазмер страх.суммы по дог. страх-я гражд. ответств-ти рисков, которые могут возникнуть у Заказчика вследствие ненадлежащего вып- работ (оказ-я услуг) ', NULL, NULL, 5, 1, 3, NULL, 5, 2, '2014-10-11 14:58:58', '2015-12-22 12:27:48', '2014-10-11', 0, NULL, NULL, 63, 1, 2, 0, '2015-12-11 09:32:29'),
	(64, 2, 3, 'Справочник Требований к предмету закупки и справочник Требований к участнику закупки (созданный Агентом, но доступный для выбора Принципалом при формировании АП)', 'Разработка механизма АИС УЦП, позволяющего Принципалам по ряду номенклатурных групп выбирать требования к предмету закупки, требования к участнику из предложенного Агентом справочника. Механизм должен работать таким образом, что Агент изначально задает. для каких номенклатурных групп  (до 3.ур) какие требования должны быть доступны принципалу ', NULL, NULL, 1, 1, 2, NULL, 5, 0, '2014-10-11 15:01:56', '2014-10-11 15:01:56', '2014-10-11', 0, NULL, NULL, 64, 1, 2, 0, NULL),
	(65, 2, 3, 'Автоматизация формирования итоговых протоколов по Работам и Услугам ', 'Автоматизация формирования итоговых протоколов по Работам и Услугам - отличие от Товаров в большем количестве разнообразных и периодически меняющихся критериев оценки', NULL, NULL, 5, 1, 2, NULL, 5, 3, '2014-10-11 15:04:18', '2015-12-22 12:27:22', '2014-10-11', 0, NULL, NULL, 65, 1, 2, 0, '2015-12-11 09:27:14'),
	(66, 2, 3, 'Автоматизация формирования договоров поставки на основе КП', 'Автоматизация формирования договоров поставки на основе КП', NULL, NULL, 1, 1, 2, NULL, 5, 1, '2014-10-11 15:04:52', '2014-10-12 22:12:09', '2014-10-11', 0, NULL, NULL, 66, 1, 2, 0, NULL),
	(67, 2, 3, 'Присвоение номенклатуре 2-го и 3- го уровней отдельных критериев оценки, требований к участнику, требований к закупке и т.д.', 'Создание механизма присвоения номенклатуре 2-го и 3- го уровней отдельных критериев оценки, требований к участнику, требований к закупке и т.д.', NULL, NULL, 5, 1, 2, NULL, 5, 3, '2014-10-11 15:05:33', '2015-12-22 12:29:08', '2014-10-11', 0, NULL, NULL, 67, 1, 2, 0, '2014-11-01 21:43:01'),
	(68, 2, 3, 'Интеграция УЦП и ЭТП – заполнение данных по прикреплению протоколов, возврат в УЦП статуса «Опубликовано»  и т.д.', 'Интеграция УЦП и ЭТП – заполнение данных по прикреплению протоколов, возврат в УЦП статуса «Опубликовано»  и т.д.', NULL, NULL, 5, 1, 1, NULL, 5, 7, '2014-10-11 15:07:17', '2016-09-12 09:59:38', '2014-10-11', 0, NULL, NULL, 68, 1, 2, 0, '2016-09-12 09:59:38'),
	(69, 2, 3, 'Механизм регистрации в АИС УЦП  ответственных за выполнение этапа закупочной процедуры ', 'Механизм регистрации в АИС УЦП  ответственных за выполнение этапа закупочной процедуры ', NULL, NULL, 1, 1, 3, NULL, 5, 0, '2014-10-11 15:08:46', '2014-10-11 15:08:46', '2014-10-11', 0, NULL, NULL, 69, 1, 2, 0, NULL),
	(70, 2, 3, 'Автоматизация уведомления участников – победителей', 'Автоматизация уведомления участников – победителей закупки о том, что они победители (для статусов Состоялся и Состоялся. Определен новый победитель разные типы уведомлений) ', NULL, NULL, 5, 1, 2, NULL, 5, 1, '2014-10-11 15:10:13', '2016-03-16 13:51:26', '2014-10-11', 0, NULL, NULL, 70, 1, 2, 0, '2016-03-16 13:51:26'),
	(71, 2, 3, 'Учет округов и регионов в АИС УЦП', 'Необходимо в АИС УЦП добавить всем контрагентам признак округа и региона по юридическому адресу. Выбор региона и округа должен осуществляться из справочника при заведении новых контрагентов.', NULL, NULL, 6, 1, 3, NULL, 5, 2, '2014-10-11 15:11:03', '2015-12-22 12:29:08', '2014-10-11', 0, NULL, NULL, 71, 1, 2, 0, '2014-11-23 23:07:11'),
	(72, 2, 3, 'для учета обеспечения заявки участника ', 'Прошу в ЛОТе во вкладке «Требования и критерии» в поле «Обеспечение заявки о подаче предложений»  указать текст по умолчанию «Не требуется»', NULL, NULL, 5, 1, 2, NULL, 5, 2, '2014-10-11 15:12:53', '2015-12-22 12:29:08', '2014-10-11', 0, NULL, NULL, 72, 1, 2, 0, '2014-11-01 21:40:07'),
	(73, 2, 3, 'Доработка заявки на МТР', 'Прошу  сделать так, чтобы при отклонении  Гипрониигазом заявки на МТР для доработки принципал мог корректировать заявку, а не создавать новую', NULL, NULL, 5, 1, 2, NULL, 5, 2, '2014-10-11 15:15:14', '2015-12-22 12:29:54', '2014-10-11', 0, NULL, NULL, 73, 1, 2, 0, '2014-10-13 14:04:34'),
	(74, 2, 3, 'Удаление неиспользуемой вкладки "График для лотов"', 'Удаление неиспользуемой вкладки "График для лотов" из панели сотрудника УЦП', NULL, NULL, 5, 1, 2, NULL, 5, 3, '2014-10-11 16:30:54', '2015-12-22 12:29:08', '2014-10-11', 0, NULL, NULL, 74, 1, 2, 0, '2014-11-01 21:39:53'),
