	(77, 3, 3, 'Приведение в порядок номенклатуры', 'Вячеслав Александрович, добрый день.\r\n\r\nЧтобы ничего не забыть, перечисляем все планируемые работы по  номенклатурному справочнику:\r\n\r\n1.Замена единиц измерения внутреннего справочника АИС УЦП на справочник ед.измерения ОКЕИ\r\n\r\n2.Блокировка для использования внутреннего справочника единиц измерения АИС УЦП\r\n\r\n3. Заполнение в номенклатурном справочнике ставкой НДС 18 % поля "НДС" во всех номенклатурных позициях с незаполненным данным полем\r\n\r\n4. Изменение файла с настойкой выгрузки номенклатурного справочника - добавление столбца "НДС"\r\n\r\n5. Изменение шаблона загрузки измененной номенклатуры в АИС УЦП  в части:\r\n\r\n5.1. добавление столбца "НДС"\r\n\r\n5.2. Обновление в АИС УЦП данных по полю "Наименование"\r\n\r\n5.3.Обновление в АИС УЦП данных по полю "Полное наименование"\r\n\r\n5.4.после загрузки файла отображение в новом столбце признака 1. что было изменено поле "Наименование"   , 2 .что было изменено поле "Полное наименование"\r\n\r\n6. заблокировать доступ к справочнику ОКДП 1, загрузить справочник ОКДП 2 (ВНИМАНИЕ: в присланном в Excel  справочнике ОКДП 2 не все данные)', NULL, NULL, 5, 1, 2, NULL, 1, 5, '2014-10-25 20:03:17', '2015-12-22 12:23:56', '2014-10-25', 0, NULL, NULL, 77, 1, 2, 0, '2015-09-27 01:20:27'),
	(78, 3, 3, 'Восстановить нумерацию в документе отчет агента', 'Сбилась нумерация\r\nпри вводе нового документа каждый раз возникает номер 9620', NULL, NULL, 5, NULL, 2, NULL, 1, 4, '2014-10-29 08:51:44', '2015-12-22 12:29:54', '2014-10-29', 0, NULL, NULL, 78, 1, 2, 0, '2014-10-29 08:53:48'),
	(79, 1, 3, 'Ошибка при формировании итогового протокола', 'Ошибка при формировании итогового протокола\r\nПроблема возникает в асдобе.\r\nНе все реквизиты правильно записываются.\r\nНо подобная ситуация более происходить не будет  - удален из анализа реквизит "дата прихода заявки на этп"', NULL, NULL, 5, 1, 2, NULL, 1, 2, '2014-10-29 10:22:10', '2015-12-22 12:29:55', '2014-10-29', 0, NULL, NULL, 79, 1, 2, 0, '2014-10-31 12:20:58'),
	(80, 5, 3, 'Обновить конфигурацию', '1. Интерфейс.СотрудникУЦП график лотов изменен на производственный календарь', NULL, NULL, 5, NULL, 2, NULL, 1, 3, '2014-10-31 12:24:54', '2015-12-22 12:29:09', '2014-10-31', 0, NULL, NULL, 80, 1, 2, 0, '2014-11-01 21:38:45'),
	(81, 1, 3, 'Ошибки в регистре "Исполнение договоров"', 'Исправление ошибки: Во вкладке "Агентское поручение" отражается выбранный поставщик, а во вкладке "Исполнение договоров" не отражается. \r\nЗакупки: 34859, 34881, 35136, 34930, 34870, 34548, 34561, 34648, 35085 \r\nпример в приложении\r\n[31.10.2014 15:00:08] Natalya Karmalikova : Исправление недоработки АИС УЦП: Ситуация по двум процедурам 34455, 34453, процедура состоялась, есть победитель. заключены договоры, договора прикреплены в АИС УЦП, но после чего поступило уведомление из УФАС \r\nБыл изменен Статус закупки на "Приостановлено заключение договора по решению ФАС". \r\nИз «Исполнение договоров» пропало наименование победителя, хотя оно должно оставаться. т.к. победитель остался тот же, и статус после заседания УФАС скорее всего вернется на прежний "Состоялся"\r\nпример в приложении', NULL, NULL, 5, NULL, 2, NULL, 1, 3, '2014-11-01 22:22:53', '2015-12-22 12:29:09', '2014-11-01', 0, NULL, NULL, 81, 1, 2, 0, '2014-11-01 22:26:40'),
	(82, 2, 3, 'Ко-во знаков у критерия оценки', 'Необходимо увеличить количество знаков для заведения наименования критерия оценки до 250', NULL, NULL, 5, 1, 3, NULL, 5, 2, '2014-11-09 21:03:51', '2015-12-22 12:27:49', '2014-11-09', 0, NULL, NULL, 82, 1, 2, 0, '2015-12-11 09:27:38'),
	(83, 3, 3, 'Срочная закупка', 'Необходимо добавить признак срочной закупки', NULL, NULL, 5, 1, 2, NULL, 1, 4, '2014-11-13 22:36:19', '2015-12-22 12:23:56', '2014-11-13', 0, NULL, NULL, 83, 1, 2, 0, '2015-09-27 01:20:21'),
	(84, 2, 3, 'доработка поля АП (ОКДП, ОКВЭД)', 'Необходимо создать два новых поля, которые принципал должен обязательно заполнить при формировании Агентского поручения "ОКДП " и "ОКВЭД".Выбор значений должен осуществляться из соответстНеобходимо создать два новых поля, которые принципал должен обязательно заполнить при формировании Агентского поручения "ОКДП " и "ОКВЭД".Выбор значений должен осуществляться из соответствующих справочников. Заведенные данные в эти поля должны соответственно отразиться в печатной форме АП (по Товарам, Работам, услугам)  , а также в печатной форме ТЗ по Товарам. Изменения не должны привести к каким-либо проблемам с формированием печатной формы по ранее созданным АП при проверке АП Агентом', NULL, NULL, 5, 1, 3, NULL, 5, 1, '2014-11-16 23:00:29', '2016-03-16 13:51:39', '2014-11-16', 0, NULL, NULL, 84, 1, 2, 0, '2016-03-16 13:51:39'),
	(85, 2, 3, 'осуществлять открытие карточки номенклатурной позиции  из табличной части документа "агентское поручение"', 'Доработка УЦП: Необходимо осуществлять открытие карточки номенклатурной позиции  из табличной части документа "агентское поручение" . Данный функционал должен быть доступен Агенту в режиме чтения без возможности откорректировать карточку номенклатурной позиции. \r\nЛИБО хотя бы отражать ID номенклатурной позиции в АП, чтоб сотрудник Агента потом мог эти позиции найти в номенклатурном справочнике. \r\nНеобходимо это потому, что часто принципалы обращаются по вопросам номенклатурных позиций, выбранных в АП, а мы не можем определить , что это за позиция, какого года номенклатурного справочника, не переведена ли она в неактуальные и т.д\r\n', NULL, NULL, 5, 1, 3, NULL, 5, 2, '2014-11-16 23:01:59', '2016-04-28 17:34:23', '2014-11-16', 0, NULL, NULL, 85, 1, 2, 0, '2016-04-28 17:34:23'),
	(86, 1, 3, 'факт отправки уведомления принципалу', 'Возобновление заявки 87646 (на портале) в связи с повтором ошибки: в АИС УЦП по новой закупке снова не отображается факт отправки уведомления принципалу должным образом (строка не выделяется рыжим цветом) пример в приложении', NULL, NULL, 5, 1, 4, NULL, 5, 1, '2014-11-16 23:07:41', '2016-03-16 13:55:09', '2014-11-16', 0, NULL, NULL, 86, 1, 2, 0, '2016-03-16 13:55:09'),
	(87, 2, 3, 'доработка отчета по прикреплению документов', 'Доработка отчета: необходимо доработать настройку отчета по прикреплению документов следующим образом: по каждому типу документов необходимо кроме ныне отражающейся даты прикрепления документа, отражать в отдельном столбце дату и время  отправки документа принципалу посредством АИС УЦП. Если это невозможно реализовать в едином отчете, тогда создать отдельный отчет по датам и времени отправки документов принципалу.  При формировании  отчета (или отчетов, если будет создан второй отчет , а не доработан ныне существующий)  сделать отбор по  дате вскрытия, дате завершения закупки, плановой дате заключения договора, а также отбор по типу документа или типам документов по списку, по которым должен сформировать отчет', NULL, NULL, 1, 1, 3, NULL, 5, 0, '2014-11-16 23:14:27', '2014-11-16 23:14:27', '2014-11-16', 0, NULL, NULL, 87, 1, 2, 0, NULL),
	(88, 1, 3, 'сбросить критерии в черновиках', 'в связи с данной проблемой: \r\n"В сентябре перестали приходить оповещения в почту из АСДОБа и АИС УЦП.\r\nНа данный момент, задачи из АСДОБа приходят, а оповещения о внесении изменений нет!\r\nЭтот вопрос критичен, т.к. изменения могут быть подписаны в день вскрытия, т.е. ежедневно, до 12.00 приходится постоянно сбрасывать фильтры и обновлять систему АИС УЦП для мониторинга возможных корректировок."\r\nПрошу к 24.11.14 всем черновикам сбросить критерии оценки. ', '2014-11-24', NULL, 5, 1, 3, NULL, 5, 2, '2014-11-16 23:24:23', '2015-12-22 12:24:12', '2014-11-16', 0, NULL, NULL, 88, 1, 2, 0, '2015-01-26 18:25:54'),
