	(115, 3, 3, 'Как добавить статью БДР в список разрешенных полей.', '\r\n\r\n\r\nMon, 22 Dec 2014 17:20:26 +0300 от Скрипкина Юлия <u.skripkina@gazenergoinform.ru>:\r\n\r\n\r\n-- \r\nС уважением,\r\nСкрипкина Юлия\r\nГлавный специалист \r\nотдела аналитики\r\nООО «Газэнергоинформ»\r\n8(812) 449-34-77 доб. 119\r\n8-911-231-88-98\r\ne-mail: u.skripkina@gazenergoinform.ru\r\n\r\n\r\n\r\n-------- Пересылаемое сообщение--------\r\n22.12.2014, 17:04, "Кисляков Павел Петрович" <p.kislyakov@spb.audit-nt.ru>:\r\n\r\nНужно в модуле формы документа «Годовой план закупок» : «ФормаДокументаУправляемая» найти имя структуры (оно уникально) «МассивРазрешенныхИмен» и добавить в нее значение «СтатьяБДР»:\r\n\r\n \r\n\r\nМассивРазрешенныхИмен.Добавить("СтатьяБДР");\r\n\r\n \r\n\r\nВ релизе 1.2.5 заполнение структуры проводится в районе строки 665.\r\n\r\n \r\n\r\nТаким образом, если зайти в строку и поменять только СтатьюБДР, то проверки будут отключены.\r\n\r\n\r\n-------- Завершение пересылаемого сообщения --------\r\n', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2014-12-22 22:58:17', '2015-12-22 12:23:09', '2014-12-22', 0, NULL, NULL, 115, 1, 2, 0, '2014-12-22 22:58:42'),
	(116, 3, 3, 'Необходимо выгрузить шаблоны договоров', 'Необходимо выгрузить шаблоны договоров на диск\r\n', NULL, NULL, 5, NULL, 2, NULL, 1, 3, '2014-12-25 21:58:44', '2015-12-22 12:23:09', '2014-12-25', 0, NULL, NULL, 116, 1, 2, 0, '2014-12-25 22:00:28'),
