	(123, 1, 3, 'Не работает РГ3', '<<< {ОбщийМодуль.РаботаСExcel.Модуль(665)}: Ошибка при вызове метода контекста (Insert): Произошла исключительная ситуация (Microsoft Excel): Для предотвращения потери данных Excel не позволяет переместить непустые ячейки за пределы листа. Выберите другое расположение для вставки новых ячеек или удалите данные, находящиеся на краю листа.\r\n\r\n\r\nэксель поддерживает до 65 тыс строк\r\nдостаточно изменить на xlsx\r\nвидимо последний раз когда готовили добавили лишних строк', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-02-02 16:39:19', '2015-12-22 11:51:41', '2015-02-02', 0, NULL, NULL, 123, 1, 2, 0, '2015-02-02 16:39:39'),
	(124, 1, 3, 'Необходимо исправить НДС в КП', 'Добрый день.\r\n\r\nКоллеги предлагаю Вам обсудить проблему округления НДС.\r\nНалоговый кодекс, часть 2 глава 21 статья 168 пункт 2 :\r\n\r\n"Сумма налога, предъявляемая налогоплательщиком покупателю товаров (работ, услуг), имущественных прав, исчисляется по каждому виду этих товаров (работ, услуг), имущественных прав как соответствующая налоговой ставке процентная доля указанных в пункте 1 настоящей статьи цен (тарифов)"\r\n\r\nТаким образом расчет НДС в "коммерческих предложениях" реализован корректно.\r\n\r\nНесовпадение итога по сумме налога контракта  и и налога исчисленного от суммы контракта действительно в данном случае может не совпадать на 0,1 коп\r\nТакая погрешность в налоговой допускается и игнорируется.\r\n\r\nПроблема возникает только с казначейством у бюджетных организаций при бюджетировании (если деньги потраченные не пойдут то на следующий период могут не дать)))))))))\r\n\r\nВсе бухгалтера знают это и идут от обратного (только с бюджетниками или если бухгалтер поработал с бюджетниками или сам был бюдж организацией - тогда будет требовать от всех), они в сумму налога исчисленного построчно добавляют 0,1 коп.\r\n\r\nКоллеги прошу Вашего участия для принятия решения.', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-02-03 16:53:09', '2015-12-22 11:51:41', '2015-02-03', 0, NULL, NULL, 124, 1, 2, 0, '2015-02-26 14:16:15'),
