	(128, 1, 3, 'Ошибки в создании корректировок', 'Вячеслав, добрый день!\r\n \r\nВозникает ошибка при корректирвоки АП.\r\n \r\nМаша проверяла в тестовой базе ошибку не смогла выявить.\r\n \r\nМы связывали по некоторым АП с Принципалам, они действительно не меняли проект договора, а при корректировки  в отчете об изменениях изменения проекта было указано.\r\n \r\nПримеры АП с ошибкой:\r\n \r\nГРО Владиковказ АП 230/1\r\nАП 221 ОАО "Газпром газораспределение Элиста"\r\n\r\nАП 263 ОАО "Газпром газораспределение Кострома"\r\n\r\nАП 380 ОАО "Газпром газораспределение Челябинск"', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-02-26 14:11:05', '2015-12-22 11:51:42', '2015-02-26', 0, NULL, NULL, 128, 1, 2, 0, '2015-02-26 14:11:23'),
