	(132, 2, 3, 'Необходимые доработки Реестра договоров', '1. Сканированная копия должна прикрепляться из всех интерфейсов прикрепления файлов.\r\n2. Флаг "Доступно ГРО" устанавливать по-умолчанию\r\n3. Дата завершения бухгалтерией\r\n4. Завершить задачи с ранее прикрепленными сканированными копиями\r\n5. Ошибка в лоте - не обнаружена\r\n6. Проверить оповещение - проверено\r\n7. Завершать БП при отказе поставщика или Заказчика', NULL, NULL, 1, NULL, 2, NULL, 1, 0, '2015-03-03 20:26:46', '2015-03-03 20:26:46', '2015-03-03', 0, NULL, NULL, 132, 1, 2, 0, NULL),
