	(137, 1, 3, 'Уточнения по Итоговым протоколам', '1 . Если участник 1 - ты в таблицу участников выводить только обязательные условия.\r\n2 . По отклоненным участникам в таблицу предложений участников выводить значение критерия = "-"', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-03-17 22:43:10', '2015-12-22 11:49:43', '2015-03-17', 0, NULL, NULL, 137, 1, 2, 0, '2015-03-17 22:43:30'),
	(138, 2, 4, 'Признак субъекта малого и среднего предпринимательства', '', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-03-18 14:03:57', '2016-02-29 10:26:03', '2015-03-18', 0, NULL, NULL, 138, 1, 2, 0, '2016-02-07 19:54:44'),
	(139, 3, 3, 'Задачи первого отдела', '1.  Прошу закрыть возможность Приципалам подписывать АП с признаком срочная закупка, без приложенного письма.\r\nПри первом подписании АП и также после корректировок. (206 АП Таганрогмежрайгаз, АП 208 Азовмежрайгаз)\r\n \r\n*Пункт 2 вынесен в отдельное задание*\r\n<pre>\r\n2. Автоматизация извещения по товарам\r\n</pre>\r\n \r\n3.Коллеги! ОЧЕРЕДНАЯ ошибка при отклонении АП – стоит признак отклонения, но нет причины отклонения и сохраняется дата подписания, из-за чего данное АП выводится в списке как непроверенное! Отклонить повторно я не могу – ошибка «Документ не подписан со стороны принципала, отклонение невозможно!» Я прошу решить данную проблему, а не сделать «что-нибудь» с конкретным АП, чтобы я отстала.  АП 316 ГРО Курск. (скриншот высылала ранее тема письма "ОШИБКА ПРИ ОТКЛОНЕНИИ АП!")\r\n \r\n4. от Ильи:  При корректировки АП заблокировать возможность выбирать номенклатуры из других групп, т.е. не из первоначально созданной. (была АП на приобретение кресла, при корректировки создали Ап на услуги)', NULL, NULL, 5, NULL, 2, NULL, 1, 4, '2015-03-22 12:12:59', '2015-12-22 11:49:43', '2015-03-22', 0, NULL, NULL, 139, 1, 2, 0, '2015-03-22 12:19:42'),
