	(150, 2, 3, 'Необходимо добавить в выгрузку для принципалов справочника "номенклатура"  поле "обобщающая позиция".', '', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-04-05 18:43:23', '2015-12-22 11:49:09', '2015-04-05', 0, NULL, NULL, 150, 1, 2, 0, '2015-04-05 18:43:40'),
	(151, 1, 3, 'Необходимо расчет НДС в спецификации привести к формуле вида 2', '1. Формула расчета НДС.\r\nПусть известна сумма S. Надо вычислить сумму НДС, составляющую 18 процентов от S.\r\nНДС= S * 18 / 100.\r\n\r\n\r\nСкачайте удобный калькулятор — любые вычисления,\r\nпроценты, расчет по формулам, запись и печать результатов\r\n2. Формула расчета суммы с НДС.\r\nПусть известна сумма S. Надо вычислить Sн — сумму с НДС. Используя формулу расчета процента от числа, получаем:\r\nSн= S + S * 18 / 100.\r\nили\r\nSн= S * (1 + 18 / 100) = S * 1.18.\r\n\r\nПримечание. В нашем калькуляторе ClasCalc есть специальная операция "прибавления процента", которая обозначается +%.\r\n3. Формула расчета суммы без НДС.\r\nПусть известна сумма с НДС Sн. Надо вычислить S — сумму без НДС. Запишем сначала формулу вычисления суммы с НДС, а потом получим из нее формулу расчета суммы без НДС.\r\nОбозначим N = 18 / 100, тогда:\r\nSн = S + N * S\r\nили\r\nSн = S * (1 + N)\r\nтогда\r\nS = Sн / (1 + N) = Sн / (1+0.18) =\r\nSн / 1.18\r\n\r\n\r\n4. Формула расчета (выделения) НДС из общей суммы.\r\nПусть известна сумма с НДС Sн. Надо вычислить сумму НДС.\r\nНДС = Sн - S\r\nИспользуем формулу расчета суммы без НДС.\r\nНДС = Sн - Sн / 1.18 =\r\nSн * (1 - 1/1.18)', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-04-05 19:08:04', '2015-12-22 11:49:09', '2015-04-05', 0, NULL, NULL, 151, 1, 2, 0, '2015-04-05 19:08:26'),
	(152, 2, 3, 'Необходимо в универсальный отчет "Цены поставщиков" вывести цены с НДС и НДС', '', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-04-07 10:08:54', '2015-12-22 11:49:09', '2015-04-07', 0, NULL, NULL, 152, 1, 2, 0, '2015-04-07 10:09:08'),
