	(155, 2, 3, 'Новая формула для Итоговых протоколов', 'Слава, добрый день\r\n \r\n \r\nЮристы внесли изменения  в Документацию и  изменилась формула для расчета по критерию Цена за единицу услуги\r\nИсправь пож-та расчет\r\n \r\n \r\n          Xmax-Xi\r\nRxi = ______________ х 100,\r\n          Xmax\r\n \r\n \r\nRxi – оценка (балл) Заявки i-го Участника по критерию «Цена за единицу услуги»;\r\nXmax – начальная (максимальная) цена за единицу услуги;\r\nXi – предложение  о цене единицы услуги по заявке  i-го Участника закупки. \r\n ', NULL, NULL, 5, NULL, 2, NULL, 1, 1, '2015-04-15 09:54:02', '2016-03-16 13:55:48', '2015-04-15', 0, NULL, NULL, 155, 1, 2, 0, '2016-03-16 13:55:48'),
	(156, 2, 3, 'Регламентное задание для Протоколистов', 'Слава, добрый день.\r\n\r\nМожно сделать в аис,чтобы уведомления по занесению сведений (сумма, номер дата) по договору появлялись Принципала в дату договора?\r\n\r\nНапример: договор от 26 марта в аис будет занесен 23го. А Принципал получит уведомление только 26го.\r\n\r\nНеобходимость связана с тем,чтобы в реестре на гоф.информация по договору не была опубликована ранее. И чтобы в случае жалобы из фас датой ранее договора в реестре не было информации о заключенном договоре. \r\n\r\n\r\nЕсли такая возможность есть, сделайте,как можно скорее. \r\n\r\nЖду обратной связи. \r\n\r\nСпасибо \r\nДина', NULL, NULL, 1, NULL, 2, NULL, 1, 0, '2015-04-15 09:56:15', '2015-04-15 09:56:15', '2015-04-15', 0, NULL, NULL, 156, 1, 2, 0, NULL),
