	(160, 1, 3, 'Необходимо исправить ошибку', 'В расчете критерия цены ошибка.\r\n \r\nВ формулу подтягивается старая цена до внесения корректировки, которая была сделана до публикации документации, и получается -0,43 бала.\r\n \r\nИсправьте, пож-та, данную ошибку не только локально.\r\nэто хорошо обратили внимание\r\n \r\nСпасибо', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-04-26 18:09:42', '2015-12-22 11:49:10', '2015-04-26', 0, NULL, NULL, 160, 1, 2, 0, '2015-04-26 18:10:07'),
