	(199, 4, 3, 'Технологический процесс проверки заявок', '', NULL, NULL, 5, NULL, 2, NULL, 1, 5, '2015-08-28 09:09:28', '2015-12-22 13:03:09', '2015-08-28', 0, NULL, NULL, 199, 1, 2, 0, '2015-12-22 11:20:58'),
	(200, 3, 3, 'АП по канцтоварам От кого:	e.korablina@gazenergoinform.ru  Кому:	Юлия Александровна Скрипкина,Служба тех.поддержки ООО "Газэнергоинформ"  сегодня, 9:08', 'Уважаемые коллеги, добрый день!\r\n\r\nВ списке АП подлежащих проверке я обнаружила АП 137 МРГ Ульяновск на закупку по номенклатурной группе "Канцтовары". Ап оформлено с указанием критериев и требований, однако в системе отметки о существовании группы Канцтовары, как агентской нет.\r\n\r\nПросьба разобраться и пояснить ситуацию.\r\n\r\nС уважением\r\nЕлена Кораблина', NULL, NULL, 5, NULL, 2, NULL, 1, 3, '2015-09-04 09:55:04', '2015-12-22 11:50:52', '2015-09-04', 0, NULL, NULL, 200, 1, 2, 0, '2015-09-04 09:56:04'),
