	(202, 3, 3, 'Отчет по работе сотрудников', '', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-09-09 18:21:08', '2015-12-22 11:46:25', '2015-09-05', 0, NULL, NULL, 202, 1, 2, 0, '2015-09-09 18:21:58'),
	(203, 2, 3, 'Опять возник вопрос по ГСМ.', '\r\n \r\nКритерии для ГСМ подтянуты на третьем уровне. Можно ли сделать так, чтобы когда закупка не более 100 т.руб. это на ГСМ не распространялось и для них были все критерии, а не только два как для закупок не более 100 т.р.??\r\n \r\nКораблина просит что-нибудь придумать.', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-09-11 10:03:29', '2015-12-22 11:46:25', '2015-09-11', 0, NULL, NULL, 203, 1, 2, 0, '2015-09-20 22:12:53'),
	(204, 3, 9, 'НДС по письму Кукушкина', '', NULL, NULL, 5, NULL, 2, NULL, 1, 1, '2015-09-15 15:03:53', '2015-09-15 15:04:13', '2015-09-15', 0, NULL, NULL, 204, 1, 2, 0, '2015-09-15 15:04:13'),
	(205, 3, 3, 'Необходимо выводить в печатные формы реквизит Описание справочник критерии', '', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-09-16 20:44:22', '2015-12-22 11:46:25', '2015-09-16', 0, NULL, NULL, 205, 1, 2, 0, '2015-09-18 11:24:45'),
	(206, 3, 3, 'Расширение выгрузки номенклатуры', 'Добрый день, Юлия!\r\n\r\n                У нас проблема – готовим Инвестиционную программу (ИП) на 2016 год, как требование в одной из форм ИП необходимо прописывать технические характеристики номенклатурных позиций строго по справочнику АИС УЦП. В АИС УЦП мы скачиваем файл в формате EXL – выгрузка номенклатуры, но там нет графы «Технические характеристики». В службу поддержки нами было отправлено письмо о срочном исправлении выгрузки номенклатуры.  Нашему ГРО 28 сентября ехать защищать ИП в Санкт-Петербург, но все тормозит отсутствие в справочнике указанной графы. Обращались с этим вопросом в УК. Подскажите как быстро будет доработана выгрузка номенклатуры в АИС УЦП?\r\n\r\n                Заранее благодарю!', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-09-18 09:08:08', '2015-12-22 11:46:25', '2015-09-18', 0, NULL, NULL, 206, 1, 2, 0, '2015-09-18 09:09:21'),
	(207, 3, 3, 'документация', 'по ЗП 67881 на ГНТ в документации если включить режим рецензирования, то  в п. 6.2.2., "Удалено" какой то участник обратился с вопросом, чего это такое, там какие то правки внесены?\r\n \r\nНаверное такого не должно быть в рабочей документации.\r\n ', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-09-24 18:09:09', '2015-12-22 11:46:25', '2015-09-24', 0, NULL, NULL, 207, 1, 2, 0, '2015-09-24 18:10:24'),
	(208, 3, 3, 'Некорректно выгружается печатная форма', 'Добрый вечер!\r\nКоллеги,  информация выгружаемая в печатную форму не соответствует электронной форме АП.\r\nв п.1 нет обоснования и в системе указано, что будет выгружено кратное наименование, а выгружается полное (скриншот ниже). \r\nСоответственно, т.к. я проверяю АП по печатной форме, я его должна отклонить, т.к. не проставлен аналог, но, судя по электронной форме, т.к. нет конкретной модели, аналог и не должен быть проставлен. Это АП отклонялось уже далеко не один раз, возможно, именно по причине некорректной выгрузки из системы. \r\nПрошу разобраться. АП отмечено Принципалом как срочное.\r\nСпасибо.', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-09-24 19:38:36', '2015-12-22 11:45:19', '2015-09-24', 0, NULL, NULL, 208, 1, 2, 0, '2015-09-24 19:39:31'),
	(209, 3, 3, 'Технология взаимодействия (Подготовка регламента)', 'Необъходимо схематично описать технологию взаимодействия', NULL, NULL, 5, NULL, 2, NULL, 1, 3, '2015-09-27 01:18:24', '2015-12-22 11:45:00', '2015-09-27', 0, NULL, NULL, 209, 1, 2, 0, '2015-09-27 01:18:51'),
