	(225, 4, 8, 'ОтчетНовости', 'Необходимо в приложенном отчете удалить поля отмеченные на скриншоте.\r\nВ группировка "Подробнее" должна иметь расшифровку и открывать Ссылку справочника "Новости".\r\nРезультат долже выводиться в управляемую форму командой выполняющей процедуру:\r\n\r\n&НаСервере\r\nПроцедура  СформироватьОтчетНовости()\r\n	\r\n	Новости.Очистить();//Новости - реквизит упр формы тип ТабличныйДокумент\r\n	\r\n	Отчет 	= Отчеты.Новости.Создать();\r\n	\r\n   	СхемаКомпоновкиДанных = Отчет.ПолучитьМакет("ОсновнаяСхемаКомпоновкиДанных");\r\n	\r\n	Настройки = СхемаКомпоновкиДанных.НастройкиПоУмолчанию;\r\n	\r\n	КомпоновщикМакета = новый КомпоновщикМакетаКомпоновкиДанных; \r\n	ДанныеРасшифровки = Новый ДанныеРасшифровкиКомпоновкиДанных;\r\n	\r\n	МакетКомпоновки = КомпоновщикМакета.Выполнить(СхемаКомпоновкиДанных, Настройки, ДанныеРасшифровки);\r\n	\r\n	процессорКомпоновки = новый ПроцессорКомпоновкиДанных;\r\n	процессорКомпоновки.Инициализировать(МакетКомпоновки);\r\n	\r\n	процессорВывода = новый ПроцессорВыводаРезультатаКомпоновкиДанныхВТабличныйДокумент;\r\n	\r\n	процессорВывода.УстановитьДокумент(Новости);\r\n	\r\n	процессорВывода.Вывести(процессорКомпоновки);\r\n	\r\nКонецПроцедуры\r\n\r\n\r\n', NULL, NULL, 1, 6, 2, NULL, 1, 0, '2015-10-26 20:25:35', '2015-10-26 20:25:35', '2015-10-26', 0, NULL, NULL, 225, 1, 2, 0, NULL),
	(226, 3, 3, 'У Уфы не подписывается ГПЗ', '', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-10-28 11:49:08', '2015-12-22 11:38:33', '2015-10-28', 0, NULL, NULL, 226, 1, 2, 0, '2015-11-02 22:36:00'),
	(227, 4, 8, 'Форма заявка на регистрацию предложений участников', 'Необходимо создать управляемую форму регистрации предложений.\r\n\r\nПо кнопке "Регистрация" создавать Документ.КоммерческоеПредложение\r\nПри подстановке значения в реквизит "номер ЗП"  осуществлять поиск  предзаполнение по Документ.Лот.НомерПроцедурыЭТП\r\n\r\nПример на скриншоте\r\nприблизительный алгоритм в приложении', NULL, NULL, 1, 6, 2, NULL, 1, 0, '2015-10-30 18:36:07', '2015-10-30 18:36:07', '2015-10-30', 0, NULL, NULL, 227, 1, 2, 0, NULL),
