	(234, 1, 3, 'Ошибка в интерфейсе принципала при формировании формы 35', 'Принципал Быковорайгаз, \r\nГРО Астрахань.\r\nПод принципалами с рабочего стола ошибка возникает, под УК с рабочего стола ошибки нет.\r\n \r\nВнешним отчетом ошибка не повторяется.\r\n \r\n03.12.2015, 11:09, "Вячеслав Рожнов" <v.rozhnov@gazenergoinform.ru>:\r\n1. Надо снести и поставить 1С:Предприятие 8.2 (8.2.17.157) тонкий клиент\r\n2. Провериь формирвоание через браузер\r\n\r\n\r\nЧетверг, 3 декабря 2015, 10:57 +03:00 от t.prohorova@gazenergoinform.ru:\r\n\r\n\r\nПривет, Слав.\r\n\r\nСо своего рабочего стола принципалы не могут сформировать отчетную форму 35, ошибка формата потока.\r\nОбратились трое принципалов, в рабочей базе я не нашла принципала, у которого НЕ возникает ошибка.\r\nВ тесте все в порядке, ошибки нет.\r\nПочистили кэш и проверили место на диске для временных файлом.\r\n\r\nМожет вечером тестирование и исправление сделать?..\r\n\r\n--\r\nС уважением,\r\nТатьяна Прохорова\r\n8(911) 846-60-56\r\nt.prohorova@gazenergoinform.ru\r\n\r\n\r\n-- \r\nВячеслав Рожнов\r\n \r\n \r\n--\r\nС уважением,\r\nТатьяна Прохорова\r\n8(911) 846-60-56\r\nt.prohorova@gazenergoinform.ru', NULL, NULL, 5, NULL, 2, NULL, 1, 3, '2015-12-06 23:50:13', '2015-12-22 11:37:06', '2015-12-06', 0, NULL, NULL, 234, 1, 2, 0, '2015-12-06 23:53:07'),
	(235, 3, 3, 'Учет договоров по новому', '', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2015-12-07 12:40:24', '2015-12-28 23:43:13', '2015-12-07', 0, NULL, NULL, 235, 1, 2, 0, '2015-12-28 23:40:17'),
	(236, 3, 3, 'Необходимо доработать отчеты агента', 'Привет.\r\n \r\nПодумай и посмотри, пожалуйста. Или может так уже делали, когда переходили от АД  к АД.\r\n \r\nБудут процедуры, которые в этом году начнутся, а закончатся в след.году со статусом не состоялась и бухгалтерия должна будет их закрыть на старый АД, т.е., который был до 30.12.2015\r\n \r\nИ процедуры, которые начнутся в декабре 2015, а закончатся в январе 2015 и можно будет их бухгалтерией закрывать на новый АД.\r\n \r\nВ общем нужно как то сделать так, чтобы была привязка к двух АД, можно ли это сделать??\r\n \r\n \r\nСпасибо.', NULL, NULL, 5, NULL, 2, NULL, 1, 3, '2015-12-07 12:48:00', '2015-12-29 08:40:13', '2015-12-07', 0, NULL, NULL, 236, 1, 2, 0, '2015-12-29 08:40:13'),
