	(256, 2, 7, 'Необходима обработка массовой обработки документов', 'Тип обрабатываемого документ РеализацияТоваровИУслуг\r\nФункции\r\n1. Проведение\r\n2. Отбор по периоду\r\n3. РегистрацияСчетов Фактур\r\n4. Создание счетов \r\n5. Печать реализаций, счетовфактур и счетов с выбором на экран или принтер\r\n6. Отчет по сопоставлению отчетов агента в 2х базах', NULL, NULL, 5, 6, 2, NULL, 1, 2, '2016-02-05 09:07:15', '2016-04-01 08:24:02', '2016-02-05', 0, NULL, NULL, 256, 1, 2, 0, '2016-04-01 08:24:02'),
