	(310, 2, 3, 'Необходимо автоматизировать расчет по критерию оценки "цена за единицу услуги" ( 1этап)', '1. Добавить поля для внесения суммарной единичной расценки;\r\n2. Вывести их в АП;\r\n3. Вывести их В документацию;\r\n4. Критерий оценки расчитать в автомате;\r\n5. Выводить критерий в протоколе вскрытия если больше ноля и основной (как решат юристы);\r\n6. Добавит табличную часть аналогично форме единичных расценок;\r\n7. Вытащить п7 в техническое задание;\r\n8. вытащить п7 в КП', NULL, NULL, 5, NULL, 2, NULL, 1, 3, '2016-04-13 11:37:14', '2016-04-28 17:31:15', '2016-04-13', 0, NULL, NULL, 310, 1, 2, 0, '2016-04-28 17:31:15'),
