	(314, 2, 3, 'Идентификация и аутентификация', 'ИЗ САГ перенести в УЦП общую форму "САГ_Регистрация"\r\nОбщая информация: пользолвател  ГОсть входит без прав и регистрируется в системе заполняя реквизиты указанные на форме. Так же пользователь прикрепляет письмо требуемого образца с делегированием ему Обществом прав доступа. При регистрации должны отправить админу (модератору) письмо.\r\nДелаем личный кабинет.\r\nАдмин Общества всегда один.\r\nИммет право включать и отключать пользователь своей организации.\r\nПользователей наполним правами позже.\r\nПока только сделаем возможность менять пароль.\r\n\r\n', NULL, NULL, 6, 6, 2, NULL, 1, 14, '2016-04-23 15:07:19', '2017-07-01 11:45:40', '2016-04-23', 0, 16, NULL, 314, 1, 2, 0, '2017-07-01 11:45:40'),
