	(322, 3, 3, 'Задачи по  номенклатурному справочнику (По письму Кукушкина)', 'Доброе утро, Коллеги.\r\n1. В очередной раз (уже третий) направляю вам запрос на внесение в выгрузку номенклатурного справочника столбца с указанием к какой редакции относится код ОКВЭД.\r\n2. Прошу подсказать в каком состоянии находится работа по моему запросу «надо сделать так, чтоб после изменения ОКДП принципалам уходило оповещение с указанием id позиции, наименования какой был код и какой стал. В лучшем варианте сделать так чтоб оповещение уходило только тем принципалам у которых использован донный код ОКДП в перечне СМП»\r\n3. В виду того что были внесены изменения в плане отнесения позиций к неактуальным (не переносятся в группы «неактуальные» и не проставляется 2013 год) путем проставления признака неактуальности.\r\nа. Необходимо в выгрузку номенклатурного справочника добавить столбец с указанием актуальности позиции.\r\nб. Убрать из выгрузки вкладку 2013 год.\r\nв. Предусмотреть в загрузке возможность проставления неактуальности помеченным позициям (в данный момент позиции переносятся в группу «неактуальные»)\r\nг. Закрыть принципалам доступ к неактуальным позициям.', NULL, NULL, 5, NULL, 2, NULL, 1, 2, '2016-05-16 12:11:20', '2016-06-01 10:50:56', '2016-05-16', 0, NULL, NULL, 322, 1, 2, 0, '2016-05-24 10:24:33'),
