	(380, 3, 3, 'Отчет "ГрафикВскрытияНаДату" для договорников и экспертов', 'В приложении пример отчета.\r\nЗапрос не меняем\r\nСоздать 2 отчета (аналог отчета в приложении) с указанными колонками и фильтрами (прислано отдельно в письме)', '2016-09-11', NULL, 5, NULL, 2, NULL, 1, 7, '2016-09-06 11:57:15', '2016-09-30 10:49:23', '2016-09-06', 0, 8, NULL, 380, 1, 2, 0, '2016-09-30 10:49:23'),
	(381, 3, 3, 'Нужен отчет  по вскрытию (Делает Кораблина ЕВ вручную)', '', NULL, NULL, 5, NULL, 2, NULL, 1, 5, '2016-09-06 13:26:47', '2016-12-30 11:45:17', '2016-09-06', 0, NULL, NULL, 381, 1, 2, 0, '2016-12-20 20:53:25'),
	(382, 2, 12, 'Необходимо установить ограничение на загрузку неактуальной номенклатуры ', '', NULL, NULL, 5, NULL, 2, NULL, 1, 1, '2016-09-08 11:47:03', '2016-09-08 11:47:20', '2016-09-08', 0, NULL, NULL, 382, 1, 2, 0, '2016-09-08 11:47:20'),
	(383, 2, 3, 'Необходимо добавить поле контроля в Учет договорв', 'Всем привет. Уже полтора года работаем с договорами через УЧЕТ ДОГОВОРОВ. \r\nИ уже ни раз сталкивались с такой проблемой: если про процедуре ФАС, нам этого не видно. И разумеется мы спокойно продолжаем крепить сканы и отправлять договоры.\r\nЧерез Исполнение договоров мы с Олей работаем крайне редко - в крайних случаях, туда заходим не каждый день, так как нам это не надо. Мы крепим и размещаем какую либо информацию о договоре только через УЧЕТ ДОГОВОРОВ.\r\nПрошу внести коррективы в нашу постоянно-рабочую вкладку УЧЕТ ДОГОВОРОВ. Это крайне необходимо. Желательно, чтобы бросалось в глаза, подсвечивание красным (любым) цветом.\r\nК примеру, в ЗП 97399 в УЧЕТЕ ДОГОВОРОВ мы видим, что с договором можно и дальше спокойно работать. Хотя по ЗП ФАС. ', NULL, NULL, 5, NULL, 2, NULL, 1, 1, '2016-09-08 12:50:59', '2016-09-08 12:51:54', '2016-09-08', 0, NULL, NULL, 383, 1, 2, 0, '2016-09-08 12:51:54'),
