	(150, 42, 'Issue', 1, 'Это не ошибка \r\nКогда возникла задача с приведением к "единому НДС" я говорил о данной ситуации что кто то из Участников может подать ошибочно на товар который не облагается НДС и что тогда делать...??\r\nТы сказала что такие ситуации разрулят в частном порядке.\r\n\r\nВот она ситуация.\r\n\r\nСчитаю что ее надо описать и не вносить изменения в конфигурацию.\r\n\r\nСтрим лайн крупный поставщик и в курсе что ПО НДС не облагатся и в тоже время пришел с НДС.\r\n', '2014-09-01 12:47:32', 0),
