	(324, 165, 'Issue', 1, '[11:30:32] Вячеслав Рожнов: 1 .Присланный отчет не показывает ничего что можно было бы использовать в анализе по данной заявке. Фильтр установленный по незаполненности значения реквизита ЕдиницаИзмерения отбирает только если тип установлен ЕдиницыИзмерений. Этим справочником мы не пользуемся уже более полу года. Сейчас актуален справочник ОКЕИ. В отчет по старому справокнику попадают 16 тыс незаполненных , но все они неактуальны. По номому справочнику не заполнено 16 позиций.\r\n2. На скриншоте в заявке видно , что у позиции единица измерения выбрана с типом "ОКЕИ" и значением "Условная единица".\r\n3. Разработчики в очередной раз отступают от идеологии программы: Во всех табличных частях всех документов реквизиты Единица Езмерения не является хранимым и выводится информативно ссылаясь на справочник номенклатура. Следуя этом принципу далее строятся все отчеты используя Единицу только из реквизита "ЕдиницаИзмерения" справочника "Номенклатура";\r\n3.1. Ошибка в запросе отчета 35 форма (один из запросов) :\r\n ////////////////////////////////////////////////////////////////////////////////\r\nВЫБРАТЬ РАЗРЕШЕННЫЕ\r\n 1 КАК UID,\r\n АгентскоеПоручениеПредметЗакупки.Номенклатура КАК Номенклатура,\r\n АгентскоеПоручениеПредметЗакупки.ЕдиницаИзмерения КАК ЕдиницаИзмерения,\r\n...................................................\r\nПОМЕСТИТЬ ВТ_ФактПоАП_Сборка\r\nИЗ\r\n Документ.АгентскоеПоручение.ПредметЗакупки КАК АгентскоеПоручениеПредметЗакупки\r\n\r\nНеобходимо :\r\nСтроку: АгентскоеПоручениеПредметЗакупки.ЕдиницаИзмерения КАК ЕдиницаИзмерения,\r\nЗаменить на : АгентскоеПоручениеПредметЗакупки.Номенклатура.ЕдиницаИзмерения КАК ЕдиницаИзмерения,\r\n\r\nПроверено с Вариантом отчета "подписанные".\r\n\r\n\r\nИменно это и надо написать АНТ вместо результатов непонятного отчета)))))))))))\r\n- 4 часа на наш групповой анализ и документирование)))))))))))))))))', '2015-05-18 11:35:31', 0),
	(325, 165, 'Issue', 1, NULL, '2015-05-18 11:35:43', 0),
	(326, 167, 'Issue', 1, 'Ошибка не зависит от типа браузера. Просто Аршинцев в нем работает и он ее нашел.\r\n\r\n96324 необходимо снять и написать АНТ:\r\n\r\n1. Ошибка не зависит от типа клиента;\r\n2. В очередной раз натыкаемся на отсутствие классов (в 2-х разных местах происходит проверка на доступность кнопки "ФормаЗаполнитьФакт");\r\n3. Нарушена логика - наличие/отсутствие строк плана по которым отсутствует факт не может преобладать над признаком подписания документа;\r\n   3,1 Проверка на подписанность и установка доступности по данному признаку в строке 16 формы КФЗ\r\n   3,2 проверка на наличие/отсутствие строк плана по которым отсутствует факт - строка 86\r\nи это все водной процедуре приСозданииНаСервере()\r\n\r\n\r\nПример: ГГР Белгород является показательной ГРО, все идет через Агента и на первый квартал 2015 отсутствовали строки в которых есть план но нет факта.\r\n\r\nИтого кнопка "ФормаЗаполнитьФакт" будет доступной даже в случае признака у документа что он подписан.', '2015-05-27 11:16:52', 0),
