	(363, 200, 'Issue', 1, 'Илья , добрый день\r\nСообщай пожалуйста Елене Викторовне о решениях по переносу.\r\n\r\n\r\n-------- Пересылаемое сообщение --------\r\nОт кого: Вячеслав Рожнов <v.rozhnov@gazenergoinform.ru>\r\nКому: Юлия Александровна Скрипкина <u.skripkina@gazenergoinform.ru>\r\nДата: Пятница, 4 сентября 2015, 9:38 +03:00\r\nТема: Re: АП по канцтоварам\r\n\r\n\r\nВопрос наверное не в том что по канцтоврам\r\nВопрос в том что калькуляторы лежат в ЭВМ а АП пишет что в канцтоварах\r\n\r\nКалькуляторы были перенесены из группы канцтовары в ЭВМ\r\nВидимо это делалось онлайн с принципалом, а после переноса есть регламент обновления характеристик позиций и у него задержка в 1 час\r\n\r\nВ АП исправил на правильню НГ\r\n\r\nПятница, 4 сентября 2015, 9:08 +03:00 от e.korablina@gazenergoinform.ru:\r\n\r\nУважаемые коллеги, добрый день!\r\n\r\nВ списке АП подлежащих проверке я обнаружила АП 137 МРГ Ульяновск на закупку по номенклатурной группе "Канцтовары". Ап оформлено с указанием критериев и требований, однако в системе отметки о существовании группы Канцтовары, как агентской нет.\r\n\r\nПросьба разобраться и пояснить ситуацию.\r\n\r\nС уважением\r\nЕлена Кораблина\r\n\r\n\r\n\r\n\r\n-- \r\nВячеслав Рожнов\r\n\r\n\r\n-- \r\nВячеслав Рожнов', '2015-09-04 09:55:26', 0),
