	(330, 295, 'attr', 'description', '1.  Прошу закрыть возможность Приципалам подписывать АП с признаком срочная закупка, без приложенного письма.\r\nПри первом подписании АП и также после корректировок. (206 АП Таганрогмежрайгаз, АП 208 Азовмежрайгаз)\r\n \r\n2. Автоматизация извещения по товарам\r\n \r\n3.Коллеги! ОЧЕРЕДНАЯ ошибка при отклонении АП – стоит признак отклонения, но нет причины отклонения и сохраняется дата подписания, из-за чего данное АП выводится в списке как непроверенное! Отклонить повторно я не могу – ошибка «Документ не подписан со стороны принципала, отклонение невозможно!» Я прошу решить данную проблему, а не сделать «что-нибудь» с конкретным АП, чтобы я отстала.  АП 316 ГРО Курск. (скриншот высылала ранее тема письма "ОШИБКА ПРИ ОТКЛОНЕНИИ АП!")\r\n \r\n4. от Ильи:  При корректировки АП заблокировать возможность выбирать номенклатуры из других групп, т.е. не из первоначально созданной. (была АП на приобретение кресла, при корректировки создали Ап на услуги)', '1.  Прошу закрыть возможность Приципалам подписывать АП с признаком срочная закупка, без приложенного письма.\r\nПри первом подписании АП и также после корректировок. (206 АП Таганрогмежрайгаз, АП 208 Азовмежрайгаз)\r\n \r\n<pre>\r\n*Пункт вынесен в отдельное задание*\r\n2. Автоматизация извещения по товарам\r\n</pre>\r\n \r\n3.Коллеги! ОЧЕРЕДНАЯ ошибка при отклонении АП – стоит признак отклонения, но нет причины отклонения и сохраняется дата подписания, из-за чего данное АП выводится в списке как непроверенное! Отклонить повторно я не могу – ошибка «Документ не подписан со стороны принципала, отклонение невозможно!» Я прошу решить данную проблему, а не сделать «что-нибудь» с конкретным АП, чтобы я отстала.  АП 316 ГРО Курск. (скриншот высылала ранее тема письма "ОШИБКА ПРИ ОТКЛОНЕНИИ АП!")\r\n \r\n4. от Ильи:  При корректировки АП заблокировать возможность выбирать номенклатуры из других групп, т.е. не из первоначально созданной. (была АП на приобретение кресла, при корректировки создали Ап на услуги)'),
