INSERT INTO `wiki_contents` (`id`, `page_id`, `author_id`, `text`, `comments`, `updated_on`, `version`) VALUES
	(1, 1, 1, '[[Excel]]\r\n[[Word]]\r\n[[Оптимизация]]\r\n[[Отчетность]]\r\n[[Оптимизация закупок]]\r\n[[Агентские поручения]]\r\n', '', '2016-06-01 11:22:44', 19),
	(2, 2, 1, '[[Препарируем IPhone]]\r\n[[Перенос контактов]]', '', '2015-01-18 22:58:44', 6),
	(3, 3, 1, '[[Как изменить стандартное расположение файлов .pst в Outlook 2010]]', '', '2015-02-05 10:43:12', 3),
	(4, 4, 1, 'СЧИямст', '', '2014-09-24 10:51:32', 1),
	(5, 5, 1, '[[Настройка сервера 1С предприятия для работы с Excel в фоне]]\r\n[[Тонкости программирования в эксель]]', '', '2015-04-17 18:49:34', 3),
	(6, 6, 1, '[[Отчетность]]\r\n[[Динамический список]]', '', '2014-09-24 12:50:27', 3),
	(7, 7, 1, '[[Общие проблемы]]\r\n[[Фильтрация групп динамического списка]]', '', '2014-09-24 10:56:34', 1),
	(8, 8, 1, '*Фильтрация групп динамического списка*\r\n\r\nЗа частую существует потребность фильтрации динамического списка по реквизиту или группе реквизитов. И вроде все в порядке и все работает, но как только возникает необходимость отфильтровать группы по реквизиту при условии что иерархия должна сохраниться и вывод в дерево и тут возникает проблема, так как это не предусмотрено платформой (или наоборот предусмотрено невозможность данного действия).\r\n\r\nСмотрим что происходит на сервере при установке фильтра по реквизиту (<Реквизит>=_Fld5714):\r\n\r\n\r\n<pre>\r\n@SELECT TOP 22\r\nT1._IDRRef,\r\nT1._Marked,\r\nT1._IsMetadata,\r\nT1._ParentIDRRef,\r\nCASE WHEN (T1._Folder = 0x00) THEN 0x01 ELSE 0x00 END,\r\nT1._Code,\r\nT1._Description,\r\nT1._Fld587,\r\nT1._Fld5714,\r\n(T1._Folder)\r\nFROM _Reference33 T1 WITH(NOLOCK)\r\nWHERE ((T1._Folder = 0x00) OR (((T1._Folder = 0x00) AND (T1._Marked = 0x00)) AND (T1._Fld5714 <> 2013))) AND (T1._ParentIDRRef = 0x9D1F00155D62110511E171B2B5A5FF1F)\r\nORDER BY ((T1._Folder)), (T1._Description), (T1._IDRRef)@\r\n</pre>\r\n\r\nВидим что у отбор осуществляется только по элементам.\r\nВидимо программисты платформы изначально заложили логику , что фильтроваться могут только элементы , а если отфильтровать группы то неизвестно что мы можем таким образом потерять скрыв группы. Но мое мнение что данная логика должна переносится на уровень пользователя и это его ответственность что и как лежит  в справочнике.\r\n\r\nИ так пути решения данной "конструктивной особенности":\r\n1. В условном оформлении динамического списка добавить видимость. Одна особенность : в выводимых полях не должно быть стандартной картинки иначе будут группы - пустышки.\r\n2. Изменить запрос в динамическом списке. Основная таблица остается та-же, добавляем внутреннее соединение с такой же таблицей и все условия ставим не нее. \r\n"Вуаля" все работает , так как платформа не контролирует условия на связанных таблицах а только на основной.\r\n', '', '2014-09-24 12:46:27', 6),
	(9, 9, 1, 'h3. Общие проблемы', '', '2014-09-24 12:38:12', 2),
	(10, 10, 1, 'h3. Отчетность\r\n\r\n\r\n\r\n', '', '2014-09-24 14:48:56', 2),
	(11, 11, 1, '6d7d649abebb5baf8a3a656b823f6a8d5aff69ac - база данных Тайм Драйв \r\n0d609c54856a9bb2d56729df1d68f2958a88426b - процессы и программы\r\n322da689358795e934015451bb9019a356e624ab - Вибер\r\n675daf50afabb6389ef43ed5454d1104513c91f1 - Вибер\r\n80bd61be557a0204aa159f2b76ac9f1a488416e1 - Вибер\r\nb39bac0d347adfaf172527f97c3a5fa3df726a3a - Вибер (база данных)', '', '2015-01-18 22:58:49', 1),
	(12, 12, 1, '[[IPhone - Sumsung]]\r\n[[Sumsung - Nokia]]\r\n[[Nokia - IPhone]]', '', '2015-01-18 23:00:24', 1),
	(13, 13, 1, 'Для того что бы перенести контакты необходимо выгрузить их в формате *.vcf\r\n', '', '2015-01-18 23:03:29', 1),
	(14, 14, 1, '*Как изменить стандартное расположение файлов .pst в Outlook 2010*\r\n\r\nЧаще всего, если жесткий диск компьютера разбит на несколько разделов, бывает удобно вынести почтовую базу с системного раздела на отдельный, так как она имеет свойство со временем выростать до неприличных размеров. Как выяснилось, в Microsoft Outlook 2010, если почтовая учетка работает по протоколу pop3, то никаких проблем изменить расположение файла .pst нет, а вот если учетка работает по протоколу imap, то все сложнее.\r\n\r\nЕсли в двух словах, то я так и не нашел, как это можно сделать средствами самого Оутглюка, пришлось подставлять костыль. В общем, если вдруг понадобилось изменить стандартное расположение файла .pst, то делаем так:\r\n\r\nПуск — Выполнить — Regedit и перейти на следующий путь:\r\nHKEY_CURRENT_USER\\Software\\Microsoft\\Office\\14.0\\Outlook\\\r\nКликнуть правой кнопкой по папке Outlook, выбрать Создать (New) — Расширяемый строковый параметр (Expandable String Value) и назвать его ForcePSTPath\r\nОткрыть новый ключ и ввести путь, где будут лежать файлы PST.\r\nДалее, при создании новых учётных записей Outlook будет создавать файлы в указанном каталоге.', '', '2015-02-05 10:44:12', 2),
	(15, 15, 5, '[[Разворачиваем сервер]]', '', '2015-03-09 18:12:42', 1),
	(16, 16, 5, '[[Ставим Апатч]]\r\n[[Ставим SQL]]', '', '2015-03-09 18:13:28', 1),
	(17, 17, 5, 'и вот зджесь описани ', '', '2015-03-09 18:13:46', 1),
	(18, 18, 1, 'h1. Тонкости программирования в эксель\r\n\r\nТаблица.Cell(1,2).Merge(Таблица.Cell(1,3));\r\n\r\nДля НомерСтроки = 2 по ПоследняяСтрока Цикл\r\n	Текст = Таблица.Cell(НомерСтроки,1).Range.Text;\r\n	Если Найти(Текст, "Технические характеристики предмета закупки") <> 0 Тогда\r\n		Таблица.Cell(НомерСтроки,1).Merge(Таблица.Cell(НомерСтроки,2));\r\n  		Таблица.Cell(НомерСтроки,2).Merge(Таблица.Cell(НомерСтроки,7));\r\n	ИначеЕсли Найти(Текст, "Значимые технические характеристики для оценки предложенных аналогов") <> 0 Тогда\r\n		Таблица.Cell(НомерСтроки,1).Merge(Таблица.Cell(НомерСтроки,2));\r\n		Таблица.Cell(НомерСтроки,2).Merge(Таблица.Cell(НомерСтроки,7));\r\n		//Таблица.Cell(НомерСтроки,1).Width = 80;\r\n		//Таблица.Cell(НомерСтроки,2).Width = 700;\r\n	Иначе\r\n		Таблица.Cell(НомерСтроки,2).Merge(Таблица.Cell(НомерСтроки,3));\r\n	КонецЕсли;\r\n	//Сообщить(ТекущаяДата());\r\n', '', '2015-04-17 18:49:08', 1),
	(19, 19, 1, '[[Настройка сервера предприятия для работы в эксель]]\r\n[[Тонкости программирования. 1С vs. Word]]\r\n[[Ошибка при формировании Экселя "Print_Area"]]\r\n[[Ошибка при вызове метода контекста (Open)]]', '', '2017-08-10 12:24:58', 7),
	(20, 20, 1, 'h1. Настройка сервера предприятия для работы в эксель\r\n\r\n**1С, тонкий клиент, работа с экселем, сервер.**\r\nВсегда сталкиваемся с проблемой запуска и работы процесса в фоновом режиме.\r\nСитуация: необходимо чтоб по запросу WEB-пользователя на сервере 1С подготавливался файл выгрузки в формате XLS или XLSX, Сохранялся и далее пользователь только скачивал ранее подготовленный файл.\r\nВарианты исполнения :\r\n> #  1. Стандартными средствами вывести результат в подготовленный шаблон типа табличный документ и сохранить его в необходимом нам формате.\r\n> >  Минусы такого подхода : оч долго (ну конечно зависит от объема).\r\n> #  2. Подготовить шаблон в формате XLSX, установить в нем подключение. \r\n> > Минусы данного подхода: Прямое подключение к БД. \r\n> > Плюсы: Но производительность берет свое и смело реализуем.\r\nПервое с чем сталкиваемся -Это работа 1С в серверном режиме и запуск Экселя на сервере.\r\n\r\n	Excel = Новый COMОбъект("Excel.Application");\r\n	Excel.DisplayAlerts = Ложь;\r\n	\r\n	ФайлExcel = Excel.Workbooks.Open(<Путь к файлу>, False);\r\n	ФайлExcel.Application.ActiveWorkbook.Connections(<Номер или Имя коннекта>).Refresh(); \r\n        <ИЛИ>                       \r\n	ФайлExcel.Application.ActiveWorkbook.RefreshAll();\r\n	\r\n	КоличествоСтрок = 0;\r\n	\r\n	Пока ФайлExcel.Sheets(<Номер или имя листа>).UsedRange.Rows.Count = 1 Цикл\r\n		\r\n		\r\n		\r\n	КонецЦикла;	\r\n	\r\n	ФайлExcel.saveas(<Путь к файлу(желательно иной так как заполняли данными мы шаблон)>);\r\n	ФайлExcel.Close();\r\n\r\nШаги необходимы для выполнения :\r\n1. Создать каталоги C:\\Windows\\System32\\config\\systemprofile\\Desktop и C:\\Windows\\SysWOW64\\config\\systemprofile\\Desktop\r\n2. Найти DCOM в службе компонентов *"Microsoft Excel Application"*, на закладке "Удостоверения" установить значение "*Текущий пользователь*" (для файловых не работает и ставим "запускающий пользователь"), на закладке "*Безопасность*" настроить права "*Разрешения на запуск и активацию*" и "Разрешения на доступ"\r\n3. И последнее не мало важное замечание : шаблон при открытии на сервере не должен задавать вопросов ибо отвечать некому)))\r\n\r\n\r\nПС - https://infostart.ru/public/196323/', '', '2019-05-28 19:51:39', 3),
	(21, 21, 1, '[[Объединение или ширина]]', '', '2015-04-17 18:58:49', 1),
	(22, 22, 1, 'И так задача:\r\nНеобходимо заполнить спецификацию, но колонку с техническими характеристиками \r\n\r\nТаблица = ActiveDocument.Sections(1).Range().Tables(4);\r\n\r\nПоследняяСтрока = Таблица.Rows.Count;\r\nСообщить(ТекущаяДата());\r\n\r\nТаблица.Cell(1,2).Merge(Таблица.Cell(1,3));\r\n\r\nДля НомерСтроки = 2 по ПоследняяСтрока Цикл\r\n Текст = Таблица.Cell(НомерСтроки,1).Range.Text;\r\n Если Найти(Текст, "Технические характеристики предмета закупки") <> 0 Тогда\r\n  Таблица.Cell(НомерСтроки,1).Merge(Таблица.Cell(НомерСтроки,2));\r\n    Таблица.Cell(НомерСтроки,2).Merge(Таблица.Cell(НомерСтроки,7));\r\n  //Таблица.Cell(НомерСтроки,1).Width = 80;\r\n  //Таблица.Cell(НомерСтроки,2).Width = 700;\r\n ИначеЕсли Найти(Текст, "Значимые технические характеристики для оценки предложенных аналогов") <> 0 Тогда\r\n  Таблица.Cell(НомерСтроки,1).Merge(Таблица.Cell(НомерСтроки,2));\r\n  Таблица.Cell(НомерСтроки,2).Merge(Таблица.Cell(НомерСтроки,7));\r\n  //Таблица.Cell(НомерСтроки,1).Width = 80;\r\n  //Таблица.Cell(НомерСтроки,2).Width = 700;\r\n Иначе\r\n  Таблица.Cell(НомерСтроки,2).Merge(Таблица.Cell(НомерСтроки,3));\r\n КонецЕсли;\r\n //Сообщить(ТекущаяДата());\r\n\r\nКонецЦикла;\r\n', '', '2015-04-17 19:02:05', 2),
	(23, 23, 1, '[[Настройки Word на сервере 1с]]', '', '2015-04-25 15:17:32', 1),
	(24, 24, 1, 'Шаги необходимы для выполнения :\r\n\r\n1. Найти DCOM в службе компонентов "Microsoft Word Application", на закладке "Удостоверения" установить значение "*Текущий пользователь*" (для файловых не работает и ставим "запускающий пользователь"), на закладке "*Безопасность*" настроить права "*Разрешения на запуск и активацию*" и "Разрешения на доступ" \r\n3. И последнее не мало важное замечание : шаблон при открытии на сервере не должен задавать вопросов ибо отвечать некому)))', '', '2019-05-28 18:07:13', 2),
